import React from "react";
import { Card, Badge } from "react-bootstrap";

function Profile() {
  const user = {
    fullName: "John Doe",
    email: "johndoe@example.com",
    profilePicture: "https://via.placeholder.com/300", // bigger placeholder
    dateJoined: "2024-01-01",
    status: "Active",
  };

  return (
    <Card style={{ maxWidth: "500px", textAlign: "center" }}>
      <Card.Img
        variant="top"
        src={user.profilePicture}
        style={{
          width: "200px",
          height: "200px",
          objectFit: "cover",
          borderRadius: "50%",
          margin: "20px auto",
        }}
      />
      <Card.Body>
        <Card.Title>{user.fullName}</Card.Title>
        <Card.Text>Email: {user.email}</Card.Text>
        <Card.Text>Date Joined: {user.dateJoined}</Card.Text>
        <Badge pill bg="success">
          {user.status}
        </Badge>
      </Card.Body>
    </Card>
  );
}

export default Profile;
